import logo from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';
import axios from 'axios';

function App() {

    const handleOTPGeneration = async () => {
        try {
            const response = await axios.post('generate-otp');
            console.log(response.data);

        } catch (error) {
            console.error('Error generating otp: ', error);
        }
    }



  return (
      <div className="App-header">
          <h1>OTP Generation</h1>
          <div className="digitContainers">
              <div className="Key">1</div>
              <div className="Key">A</div>
              <div className="Key">2</div>
              <div className="Key">B</div>
              <div className="Key">F</div>
          </div>


          <Button onClick={handleOTPGeneration} className="GenButton" variant="outlined">Generate New</Button>


          <p className="TimeText">Time Left To Use: </p>
      </div>
  );
}

export default App;
